"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Ear infections (otitis media) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/ear-infections-otitis-media-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H392742090\">",
"      <span class=\"h1\">",
"       What is an ear infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;An ear infection is a condition that can cause pain in the ear, fever, and trouble hearing. Ear infections are common in children.",
"     </p>",
"     <p>",
"      Ear infections often occur in children after they get a cold. Fluid can build up in the middle part of the ear behind the eardrum. This fluid can become infected and press on the eardrum, causing it to bulge (",
"      <a class=\"graphic graphic_figure graphicRef54739 \" href=\"mobipreview.htm?26/44/27332\">",
"       figure 1",
"      </a>",
"      ). This causes symptoms.",
"     </p>",
"     <p>",
"      In some children, some fluid can stay in the ear for weeks to months after the pain and infection have gone away. This fluid can impair hearing and can sometimes lead to problems with language and speech.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H392742097\">",
"      <span class=\"h1\">",
"       What are the symptoms of an ear infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In infants and young children, the symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Pulling on the ear",
"       </li>",
"       <li>",
"        Being more fussy or less active than usual",
"       </li>",
"       <li>",
"        Having no appetite and not eating as much",
"       </li>",
"       <li>",
"        Vomiting or diarrhea",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In older children, symptoms often include ear pain or temporary hearing loss.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H392742104\">",
"      <span class=\"h1\">",
"       How do I know if my child has an ear infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you think your child has an ear infection, see a doctor or nurse. The doctor or nurse should be able to tell if your child has an ear infection. He or she will ask about symptoms, do an exam, and look in your child&rsquo;s ears.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H392742111\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to help my child feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You can give your child medicine, such as",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?19/35/20021?source=see_link\">",
"       acetaminophen",
"      </a>",
"      (sold as Tylenol&reg;) or",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      (sold as Advil&reg;) to reduce the pain and fever. But never give",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?6/12/6342?source=see_link\">",
"       aspirin",
"      </a>",
"      to a child younger than 18 years old. Aspirin can cause a dangerous condition called Reye syndrome.",
"     </p>",
"     <p>",
"      Most doctors do not recommend treating ear infections with cold and cough medicines. These medicines can have dangerous side effects in young children.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H392742118\">",
"      <span class=\"h1\">",
"       How are ear infections treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors can treat ear infections with antibiotics. These medicines kill the bacteria that cause some ear infections. But doctors do not always prescribe these medicines right away. That&rsquo;s because many ear infections are caused by viruses &mdash; not bacteria &mdash; and antibiotics do not kill viruses. Plus, many children get over ear infections without antibiotics. &nbsp;",
"     </p>",
"     <p>",
"      Doctors usually prescribe antibiotics to treat ear infections in infants younger than 2 years old. For children older than 2, doctors sometimes hold off on antibiotics.",
"     </p>",
"     <p>",
"      Your child&rsquo;s doctor might suggest watching your child&rsquo;s symptoms for a day or two before trying antibiotics if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Your child is healthy in general",
"       </li>",
"       <li>",
"        The pain and fever are not severe",
"       </li>",
"       <li>",
"        The ear exam did not show a definite ear infection",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You and your doctor should discuss whether or not to give your child antibiotics. This will depend on your child&rsquo;s age, health problems, and how many ear infections he or she has had in the past.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H392742125\">",
"      <span class=\"h1\">",
"       When should I follow up with the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should call the doctor or nurse:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        After 1 to 2 days, if you are watching your child&rsquo;s symptoms. If the pain and fever have not gotten better, your doctor might prescribe antibiotics.",
"       </li>",
"       <li>",
"        After 2 days, if your child is taking antibiotics and his or her symptoms have not improved or are worse.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should also see the doctor or nurse a few months after an ear infection if your child is younger than 2 or has language or learning problems. Your doctor or nurse will do an ear exam to make sure the fluid is gone. Your child might also need follow-up testing to check his or her hearing.",
"     </p>",
"     <p>",
"      If the fluid in the ear does not go away, your doctor might suggest treatment to help drain the fluid. This involves a surgery in which a doctor places a small tube in the eardrum (",
"      <a class=\"graphic graphic_figure graphicRef67163 \" href=\"mobipreview.htm?23/8/23680\">",
"       figure 2",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H392742132\">",
"      <span class=\"h1\">",
"       Can I reduce the number of ear infections my child gets?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your child gets a lot of ear infections, ask the doctor what you can do to prevent repeat infections. The doctor might suggest that your child:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Take an antibiotic every day during certain months of the year",
"       </li>",
"       <li>",
"        Have surgery to place a small tube in the eardrum",
"       </li>",
"       <li>",
"        Get routine vaccines",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H392742082\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
