"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?32/47/33522?source=see_link\">",
"       Patient information: Flu (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?11/48/12035?source=see_link\">",
"       Patient information: Vaccines (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?0/57/914?source=see_link\">",
"       Patient information: Sore throat in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?20/9/20626?source=see_link\">",
"       Patient information: Ear tubes (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?11/1/11282?source=see_link\">",
"       Patient information: Tonsillectomy and adenoidectomy in children (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?15/16/15619?source=see_link\">",
"       Patient information: Ear infections (otitis media) in children (Beyond the Basics)",
"      </a>",
"     </p>",
