var title_f43_38_44651="Diagnostic criteria for CMML";
var content_f43_38_44651=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F85786&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F85786&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for chronic myelomonocytic leukemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Persistent peripheral blood monocytosis &gt;1x10",
"        <sup>",
"         9",
"        </sup>",
"        /L",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No Philadelphia chromosome or",
"        <em>",
"         BCR-ABL1",
"        </em>",
"        fusion gene",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No rearrangement of",
"        <em>",
"         PDGFRA",
"        </em>",
"        or",
"        <em>",
"         PDGFRB",
"        </em>",
"        (should be specifically excluded in cases with eosinophilia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fewer than 20 percent blasts* in the blood and in the bone marrow",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dysplasia in one or more myeloid lineages. If myelodysplasia is absent or minimal, the diagnosis of CMML may still be made if the other requirements are met, and:",
"        <br/>",
"        <ul>",
"         <li>",
"          An acquired, clonal cytogenetic or molecular genetic abnormality is present in the haemopoietic cells,",
"          <em>",
"           or",
"          </em>",
"         </li>",
"         <li>",
"          The monocytosis has persisted for at least three months",
"          <em>",
"           and",
"          </em>",
"         </li>",
"         <li>",
"          All other causes of monocytosis have been excluded",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CMML: chronic myelomonocytic leukemia.",
"     <br/>",
"     * Blasts include myeloblasts, monoblasts, and promonocytes. Promonocytes are monocytic precursors with abundant light grey or slightly basophilic cytoplasm with a few scattered, fine lilac-colored granules, finely-distributed, stippled nuclear chromatin, variably prominent nucleoli, and delicate nuclear folding or creasing, and in this classification are equivalent to blasts. Abnormal monocytes that can be present both in the peripheral blood and bone marrow are excluded from the blast count.",
"    </div>",
"    <div class=\"reference\">",
"     From Swerdlow SH, Campo E, Harris NL, Jaffe ES, Pileri SA, Stein H, Thiele J, Vardiman JW. World Health Organization Classification of Tumours of Haematopoietic and Lymphoid Tissues. IARC, Lyon, 2008. Reproduced with permission. Copyright &copy; 2008 IARC.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
