var title_f43_38_44652="Advantages and disadvantages of different types of nebulizers";
var content_f43_38_44652=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F64982&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F64982&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Advantages and disadvantages of different types of nebulizers",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Types of nebulizers",
"       </td>",
"       <td class=\"subtitle1\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Disadvantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Brands",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Jet",
"         </strong>",
"        </p>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Less expensive",
"         </li>",
"         <li>",
"          Enhanced designs have improved performance and reduced aerosol waste during the exhalation phase",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Require a source of compressed air or oxygen",
"         </li>",
"         <li>",
"          Lower efficiency",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Breath-enhanced, open-vent:",
"        <br/>",
"        <ul>",
"         <li>",
"          Pari LC Plus&reg;",
"         </li>",
"         <li>",
"          Pari LC Star&reg;",
"         </li>",
"         <li>",
"          Pari Baby&reg;",
"         </li>",
"         <li>",
"          Ventstream&reg;",
"         </li>",
"        </ul>",
"        <br/>",
"        Storage bag:",
"        <br/>",
"        <ul>",
"         <li>",
"          Circulaire&reg; (Westmed)",
"         </li>",
"        </ul>",
"        <br/>",
"        Nebulizers with closed scavenging systems for toxic medications:",
"        <br/>",
"        <ul>",
"         <li>",
"          Respigard II&reg;",
"         </li>",
"         <li>",
"          SPAG&reg;",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Ultrasonic",
"        </strong>",
"        *",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Do not require a source of driving gas",
"         </li>",
"         <li>",
"          Can nebulize large volumes of liquid",
"         </li>",
"         <li>",
"          Shorter delivery time than jet nebulizers",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Larger aerosolized particle sizes",
"         </li>",
"         <li>",
"          High density aerosols can cause bronchospasm and increased airway resistance",
"         </li>",
"         <li>",
"          Lower efficiency",
"         </li>",
"         <li>",
"          May breakdown complex molecules",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Drive Medical Beetle Neb&reg; Compact Ultrasonic Nebulizer",
"         </li>",
"         <li>",
"          DuroMed MiniBreeze&reg; Ultrasonic Nebulizer",
"         </li>",
"         <li>",
"          Veridian Healthcare Sonic Mist&reg; Ultrasonic Nebulizer",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Vibrating mesh",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Do not require a source of driving gas",
"         </li>",
"         <li>",
"          Shorter delivery time than jet nebulizers",
"         </li>",
"         <li>",
"          Aerosolized particles are highly uniform and respirable",
"         </li>",
"         <li>",
"          More portable (light weight and smaller size)",
"         </li>",
"         <li>",
"          More efficient than jet nebulizer (minimizes drug waste)",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          More expensive",
"         </li>",
"         <li>",
"          Require disassembly and cleaning after each use",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          eFlow&reg;, Altera&reg;, Trio&reg; (PARI Innovative Manufacturers Inc.)",
"         </li>",
"         <li>",
"          Aeroneb&reg; (Aerogen)",
"         </li>",
"         <li>",
"          MicroAIR&reg;, NE-U22 (OMRON)",
"         </li>",
"         <li>",
"          I-neb&reg; (Respironics)",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Ultrasonic nebulizers are rarely used.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
